import React, { useState, useEffect } from "react";
import "./home.scss";
import { useNavigate } from "react-router-dom";
import { useSelector, useDispatch } from "react-redux";
import {
  fetchCustomers,
  clearErrors,
} from "../../redux/Actions/CustomerAction";
import LoaderFirst from "../../components/Loaders/LoaderFirst";

import { ToastContainer, toast } from "react-toastify";

const Home = () => {
  const dispatch = useDispatch();
  const { customers, loading, error } = useSelector((state) => state.customers);
  // const loading = useSelector((state) => state.loading);
  // const error = useSelector((state) => state.error);

  const Navigate = useNavigate();
  const [searchInput, setSearchInput] = useState("");
  const [suggestions, setSuggestions] = useState([]);
  const [selectedValue, setSelectedValue] = useState("");
  const [submitting, setSubmitting] = useState(false);


  useEffect(() => {
    dispatch(fetchCustomers());
    return () => {
      dispatch(clearErrors());
    };
  }, [dispatch]);
  const handleInputChange = (event) => {
    const input = event.target.value;
    setSearchInput(input);

    if (customers && input) {
      // Filter suggestions based on the input
      const filteredSuggestions = customers.filter(
        (suggest) =>
          suggest.first_name.toLowerCase().includes(input.toLowerCase()) ||
          suggest.last_name.toLowerCase().includes(input.toLowerCase()) ||
          suggest.contact_no.includes(input)
      );

      const limitedSuggestions = filteredSuggestions.slice(0, 4); // Limit to 4 suggestions

      setSuggestions(limitedSuggestions);
    } else {
      setSuggestions([]); // Clear suggestions if input is empty
    }
  };

  const handleSuggestionClick = (value) => {
    setSelectedValue(value);
    setSearchInput(value);
    setSuggestions([]);
  };

  const handleSubmit = () => {

    if (!selectedValue) {
      // Display an alert if the selected value is empty
      toast("Please fill the Name or Phone Number first");
      return;
    }


    localStorage.removeItem("BookingData");
    localStorage.removeItem("SelectedData");
    localStorage.removeItem("selectedProducts");

    setSubmitting(true);
    const selectedCustomer = customers.find(
      (customer) =>
        customer.first_name + customer.last_name === selectedValue ||
        customer.contact_no === selectedValue
    );
  
    if (selectedCustomer) {
      // Retrieve existing data from localStorage
      const existingData = localStorage.getItem("BookingData");
  
      const bookingData = {
        first_name: selectedCustomer.first_name,
        last_name: selectedCustomer.last_name,
        contact_no: selectedCustomer.contact_no,
        // Add other fields of the customer object here
      };
  
      if (existingData) {
        // Parse the existing data as an array
        const dataArray = JSON.parse(existingData);
  
        // Push the new user data to the array
        dataArray.push(bookingData);
  
        // Save the updated array back to localStorage
        localStorage.setItem("BookingData", JSON.stringify(dataArray));
      } else {
        // Create a new array with the user data
        const dataArray = [bookingData];
  
        // Save the array to localStorage
        localStorage.setItem("BookingData", JSON.stringify(dataArray));
        
      }
    }
  
    Navigate("/services/women");
  };
  

  useEffect(() => {
    if (error) {
      // Display an alert with the error message
      toast(`Error: ${error}`);
    }
  }, [error]);

  return (
    <>
      <div id="StartBook">
        <svg
          width="371"
          height="188"
          viewBox="0 0 371 188"
          fill="none"
          xmlns="http://www.w3.org/2000/svg"
          xmlnsXlink="http://www.w3.org/1999/xlink"
        >
          <rect width="371" height="188" fill="url(#pattern0)" />
          <defs>
            <pattern
              id="pattern0"
              patternContentUnits="objectBoundingBox"
              width="1"
              height="1"
            >
              <use
                xlinkHref="#image0_6_367"
                transform="matrix(0.000926784 0 0 0.00182892 0 -0.00661073)"
              />
            </pattern>
            <image
              id="image0_6_367"
              width="1079"
              height="554"
              xlinkHref="data:image/png;base64,"
            />
          </defs>
        </svg>

        <div id="suggestionsBox">
          <h2>SELECT CUSTOMER</h2>
          <input
            placeholder="Name/Phone Number"
            type="text"
            value={searchInput}
            onChange={handleInputChange}
          />
          {loading ? (
            <LoaderFirst />
          ) : (
            suggestions.length > 0 && (
              <ul className="suggestions">
                {suggestions.map((suggestion) => (
                  <li
                    key={suggestion.id}
                    className="suggestion-item"
                    onClick={() =>
                      handleSuggestionClick(
                        suggestion.first_name + suggestion.last_name || suggestion.contact_no
                      )
                    }
                  >
                    <span>
                      {suggestion.first_name} {suggestion.last_name}
                    </span>
                    <span>{suggestion.contact_no}</span>
                  </li>
                ))}
              </ul>
            )
          )}
          <button type="submit" onClick={handleSubmit}>
            Submit
          </button>
        </div>
      </div>

      <ToastContainer position="bottom-right" />
    </>
  );
};

export default Home;
